import './App.css';
import { Encabezado } from './components/NavBar.js';
import { Presentation } from './components/Presentation.js';
import { Project } from './components/Project.js';
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  return (
    <div className="App">
      <Encabezado />
      <Presentation />
      <Project
        image="asterisk"
        ext="svg"
        name="Technology commerce"
        desc="This is a school project done by 4 people that I worked on. Basically it is a commerce like Amazon or eBay but oriented to IT stuff." />
    </div>
  );
}

export default App;
